import React, { useContext } from "react";
import "./CartItems.css";
import { ShopContext } from "../../Context/ShopContext";
import remove_icon from "../Assets/cart_cross_icon.png";
import { Button, Image, Container, Row, Col } from "react-bootstrap";

const CartItems = () => {
  const { getTotalCartAmount, all_product, cartItems, removeFromCart } =
    useContext(ShopContext);

  return (
    <Container>
      <Row>
        <Col>
          <div className="custom-cartitems">
            <div className="custom-cartitems-format-main">
              <p>Products</p>
              <p>Title</p>
              <p>Price</p>
              <p>Quantity</p>
              <p>Total</p>
              <p>Remove</p>
            </div>
            <hr className="custom-cartitems-hr" />
            {all_product.map((e) => {
              if (cartItems[e.id] > 0) {
                return (
                  <div
                    className="custom-cartitems-format custom-cartitems-format-main"
                    key={e.id}
                  >
                    <Image
                      src={e.image}
                      alt=""
                      className="custom-carticon-product-icon"
                    />
                    <p>{e.name}</p>
                    <p>${e.new_price}</p>
                    <Button
                      variant="outline-dark"
                      className="custom-cartitems-quantity"
                    >
                      {cartItems[e.id]}
                    </Button>
                    <p>${e.new_price * cartItems[e.id]}</p>
                    <img
                      className="custom-cartitems-remove-icon"
                      src={remove_icon}
                      onClick={() => {
                        removeFromCart(e.id);
                      }}
                      alt=""
                    />
                  </div>
                );
              }
              return null;
            })}
            <div className="custom-cartitems-down">
              <div className="custom-cartitems-total">
                <h1>Cart Totals</h1>
                <div>
                  <div className="custom-cartitems-total-item">
                    <p>Subtotal</p>
                    <p>${getTotalCartAmount()}</p>
                  </div>

                  <div className="custom-cartitems-total-item">
                    <p>Shipping Fee</p>
                    <p>Free</p>
                  </div>

                  <div className="custom-cartitems-total-item">
                    <h3>Total</h3>
                    <h3>${getTotalCartAmount()}</h3>
                  </div>
                </div>
                <Button variant="primary">PROCEED TO CHECKOUT</Button>
              </div>
              <div className="custom-cartitems-promocode">
                <p>If you have a promo code, Enter it here</p>
                <div className="custom-cartitems-promobox">
                  <input
                    type="text"
                    placeholder="promo code"
                    className="custom-cartitems-promo-input"
                  />
                  <Button
                    variant="secondary"
                    className="custom-cartitems-promo-button"
                  >
                    Submit
                  </Button>
                </div>
              </div>
            </div>
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default CartItems;
